// src/Dashboard.js
import React from 'react';
import { Container, Typography, Grid, Paper } from '@mui/material';
import Inventory from './Inventory'; // Import Inventory component
import LabelPrinter from './LabelPrinter'; // Import LabelPrinter component

const Dashboard = () => {
    return (
        <Container>
            <Typography variant="h4" gutterBottom align="center">
                Dashboard
            </Typography>
            <Grid container spacing={4}>
                <Grid item xs={12} sm={6}>
                    <Paper elevation={3} style={{ padding: '20px' }}>
                        <Typography variant="h5" gutterBottom>
                            Inventory
                        </Typography>
                        <Inventory /> {/* Render Inventory component */}
                    </Paper>
                </Grid>
                <Grid item xs={12} sm={6}>
                    <Paper elevation={3} style={{ padding: '20px' }}>
                        <Typography variant="h5" gutterBottom>
                            Label Printer
                        </Typography>
                        <LabelPrinter /> {/* Render LabelPrinter component */}
                    </Paper>
                </Grid>
            </Grid>
        </Container>
    );
};

export default Dashboard;
